--  DDL for Procedure DML_GUVENLIK
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "HASTANE"."DML_GUVENLIK" IS
BEGIN
    IF TO_CHAR(SYSDATE,'HH24:MI') NOT BETWEEN '08:00' AND '18:00'
        OR TO_CHAR(SYSDATE,'DY') IN ('CMT','PAZ') THEN
        RAISE_APPLICATION_ERROR(-20205,'MESAÝ SAATLERÝ DIÞINDA VERÝ ÝÞLEME YAPILAMAZ');
    END IF;
END;

