--------------------------------------------------------
--  DDL for Package MY_TYPE
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE PACKAGE "HASTANE"."MY_TYPE" AS
    TYPE hstData IS RECORD(
        hst_no hasta.hasta_no%type,
        hst_ad hasta.ad%type
    );
    PI CONSTANT NUMBER(3,2) :=3.14;
    TYPE cursor_type IS REF CURSOR;
    my_exception EXCEPTION;
    PROCEDURE doktorlar(p_id POLIKLINIK.POLIKLINIK_KODU%TYPE);
    FUNCTION daire_alan(r number) RETURN NUMBER;
end my_type;

/
--------------------------------------------------------
--  DDL for Package Body MY_TYPE
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE PACKAGE BODY "HASTANE"."MY_TYPE" AS
    PROCEDURE doktorlar(p_id POLIKLINIK.POLIKLINIK_KODU%TYPE) IS
        w_hst_data my_type.hstData;
        chst    my_Type.cursor_type;
        BEGIN
            open chst for select doktor_no,ad from doktor WHERE POLIKLINIK_KODU =p_id;
            loop
                fetch chst INTO w_hst_data;
                EXIT WHEN chst%notfound;
                dbms_output.put_line(w_hst_data.hst_no || w_hst_data.hst_ad );
            end loop;
            close chst;
        END;
    FUNCTION daire_alan(r number) RETURN NUMBER IS
         w_sonuc number;
    BEGIN
         w_sonuc := PI * power(r,2);
         return w_sonuc;
    END;

end my_type;

/
--------------------------------------------------------
--  DDL for Function FAKTORIYEL
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE FUNCTION "HASTANE"."FAKTORIYEL" (n NUMBER) RETURN NUMBER IS
    factt NUMBER := 1;
BEGIN
    IF n = 0 THEN 
        factt := 1;
    ELSIF n = 1 THEN 
        factt := 1;
    ELSIF n < 0 THEN 
        factt := NULL;
    ELSE 
        factt := n * faktoriyel(n - 1);
    END IF;
    RETURN factt;
END;

